import { useState } from "react";
import { motion, AnimatePresence } from 'framer-motion'
const array = [{id:1,title:"リンク"},{id:2,title:"<a>"},{id:3,title:"段落"},{id:4,title:"<p>"}]


export const Test =()=>{
  const [count, setCount] = useState(0)
  const [state, setState] = useState(array[0]);
  const handleOnClick =()=>{
    setCount(count+1)
    setState(array[count]);
  }

  return(
    <div className="flex justify-center items-center h-96 bg-red-200">
    <AnimatePresence>
      <motion.div animate>
        <div className="flex justify-center items-center text-3xl w-full bg-red-500 h-96" onClick={handleOnClick}>
          {state.title}
        </div>
      </motion.div>
      </AnimatePresence>
    </div>
  );
}
